import React, { Component } from "react";
import "./App.css";
import Pokecard from "./Pokecard";

function App() {
  return (
    <div className="App">
      <Pokecard id={4} name="Charmander" type="Fire" exp={62} />
      <Pokecard id={7} name="Squirtle" type="Water" exp={63} />
      <Pokecard id={11} name="Metapod" type="Bug" exp={72} />
      <Pokecard id={12} name="Butterfree" type="Flying" exp={178} />
      <Pokecard id={25} name="Pikachu" type="Electric" exp={112} />
      <Pokecard id={39} name="Jigglypuff" type="Normal" exp={95} />
      <Pokecard id={94} name="Genger" type="Poison" exp={225} />
      <Pokecard id={133} name="Evee" type="Normal" exp={65} />
    </div>
  );
}

export default App;
